              start={"From 799"}
            />
          </div>
        </div>
        <div className="product-catalog">
          <Heading title={"Fashion"} heading={"Trending Fashion"} />
          <div className="grid grid-cols-6 ">
            <div className="h-60 w-60 relative flex justify-center items-center">
              <div className="absolute bottom-0  w-44 h-44 bg-orange-200 rounded-full"></div>
